import React, { useState } from "react";
import '../cssPages/signin.css'


function Signin(){
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    React.useEffect(() => {
        // 페이지에 들어올 때 배경 변경
        document.body.classList.add('page-white-bg');
        return () => {
            // 페이지를 떠날 때 원래 배경 복원
            document.body.classList.remove('page-white-bg');
        };
    }, []);

    return(
        <div className="wholeSignIn">
            <p className="title">Sign in</p>
            <p>E-mail</p>
            <input type="text" className="email" value={email} />
        
            <p>Password</p>
            <input type="text" className="password" value={password} />
            <div className="signButtons">
                <button className="sign">Sign in</button>
                <button>Sign up</button>
            </div>
        </div>
    );
}

export default Signin;
